<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8">
<title>Call Tree Block Visualization</title>
<style>
    body {
        margin: 0;
        font-family: system-ui, -apple-system, sans-serif;
        background: #1a1a1a;
        color: #f0f0f0;
    }
    
    .vis-container {
        position: relative;
        width: 100vw;
        height: 100vh;
    }
    
    .block {
        position: fixed;
        box-sizing: border-box;
        left: calc(var(--x) * 1vw);
        bottom: calc(var(--y) * 1vh);
        width: calc(var(--w) * 1vw);
        height: calc(var(--h) * 1vh);
        background-color: var(--color);
        cursor: pointer;
    }

    /* highlight a block but not its parents */
    .block:hover:not(:has(.block:hover)) {
        background-color: var(--hover-color);
    }
    
    .block.collapsed > .block {
        display: none;
    }
    
    #info {
        position: fixed;
        top: 20px;
        right: 20px;
        background: rgba(40, 40, 40, 0.80);
        border: 1px solid #555;
        padding: 15px;
        border-radius: 8px;
        max-width: 400px;
        font: 13px 'Courier New', monospace;
        white-space: pre-wrap;
        cursor: pointer;
    }
    #info.icon {
        width: 20px;
        height: 20px;
        overflow: hidden;
        font-size: 0;
    }
    #info.icon::before {
        content: "i";
        font-size: 20px;
        text-align: center;
    }

</style>
</head>

    <div id="info"></div>
    <script>
        const info = document.getElementById('info');
        info.textContent = 'Click a block to display its info';
        info.classList.add('icon'); 
        document.querySelectorAll('.block').forEach(block => {
            block.addEventListener('click', e => {
                e.stopPropagation();
                if (e.detail === 1) {
                    info.textContent = e.currentTarget.title;
                    info.classList.remove('icon');  // expand info panel
                }
            });
            block.addEventListener('dblclick', e => {
                e.stopPropagation();
                e.currentTarget.classList.toggle('collapsed');
            });
        });

        // Info panel click - toggle icon/expanded state
        info.addEventListener('click', e => {
            e.stopPropagation();
            info.classList.toggle('icon');
        });
    </script>
